// src/pages/ServiceDetail.jsx
import React, { useEffect } from "react";
import { useParams, Link, useNavigate } from "react-router-dom";
import services from "../data/services";
import { WHATSAPP_NUMBER } from "../config";
import ImageWithPreview from "../components/ImageWithPreview";

function openWhatsApp(item) {
  const text = `Namaste, main booking karna chahta/chahti hoon: *${item.name}* (Price: ₹${item.price}). Duration: ${item.time}.`;
  if (!WHATSAPP_NUMBER || WHATSAPP_NUMBER.includes("X")) {
    alert("WhatsApp number set nahi hua — src/config.js me WHATSAPP_NUMBER variable me phone number daal dijiye.");
    return;
  }
  const url = `https://wa.me/${WHATSAPP_NUMBER}?text=${encodeURIComponent(text)}`;
  window.open(url, "_blank");
}

export default function ServiceDetail() {
  const { id } = useParams(); // <- correct: inside component
  const navigate = useNavigate();
  const decodedId = decodeURIComponent(id || "");
  const section = services.find((s) => s.id === decodedId);

  // scroll to top when page opens
  useEffect(() => {
    window.scrollTo({ top: 0, left: 0, behavior: "auto" });
  }, [id]);

  if (!section) {
    return (
      <div className="max-w-4xl mx-auto px-4 py-20 text-center">
        <h2 className="text-2xl font-semibold">Service not found</h2>
        <p className="mt-3 text-gray-500">Requested service does not exist.</p>
        <div className="mt-6 flex justify-center gap-3">
          <button onClick={() => navigate(-1)} className="px-4 py-2 bg-accent text-white rounded-md">← Back</button>
          <Link to="/" className="px-4 py-2 border rounded-md">View All Services</Link>
        </div>
      </div>
    );
  }

  return (
    <section className="max-w-6xl mx-auto px-4 py-12">
      <div className="flex items-start justify-between gap-4 mb-6">
        <div>
          <h1 className="text-3xl font-bold text-strong">{section.title}</h1>
          {section.subtitle && <p className="text-sm text-gray-500 mt-1">{section.subtitle}</p>}
        </div>

        <div className="flex items-center gap-2">
          <button onClick={() => navigate(-1)} className="px-3 py-2 border rounded-md">← Back</button>
          <Link to="/" className="px-3 py-2 bg-accent text-white rounded-md">All Services</Link>
        </div>
      </div>

      <div className="grid gap-6 md:grid-cols-2 lg:grid-cols-3">
        {section.items.map((it, idx) => {
          let imgSrc = it.img || "";
          if (typeof imgSrc === "string" && (imgSrc.startsWith("../img/") || imgSrc.startsWith("./img/"))) {
            const name = imgSrc.split("/").pop();
            imgSrc = `/assets/${name}`;
          }
          if (imgSrc && !imgSrc.startsWith("/") && imgSrc.includes("assets/")) imgSrc = `/${imgSrc}`;

          const hasImage = !!(imgSrc && imgSrc.trim());

          return (
            <article key={idx} className="bg-white rounded-xl border p-4 shadow-sm hover:shadow-strong transition">
              {hasImage && (
                <div className="mb-3">
                  <ImageWithPreview src={imgSrc} alt={it.name} wrapperClass="h-72 md:h-80 lg:h-96" />
                </div>
              )}

              <div className="mt-4 flex-1">
                <div className="flex items-center justify-between">
                  <h3 className="text-lg font-semibold">{it.name}</h3>
                  <div className="text-accent font-semibold">₹{it.price}</div>
                </div>

                {it.dis && <p className="mt-2 text-sm text-gray-600">{it.dis}</p>}

                <div className="mt-3 flex items-center justify-between">
                  <div className="text-sm text-gray-500">⏳ {it.time}</div>
                  <button onClick={() => openWhatsApp(it)} className="px-4 py-2 bg-strong text-white rounded-md">Book on WhatsApp</button>
                </div>
              </div>
            </article>
          );
        })}
      </div>
    </section>
  );
}
